  render() {
    return (
      <div className="App">
              <Particles
        params={{
          particles: {
            number: {
              value: 200,
              density: {
                enable: true,
                value_area: 1000,
              }
            },
          },
        }}
      />
        <header className="App-header">
        </header>
      </div>
    );
  }
}
